import React from 'react';
import './App.scss';

function App() {
  const categories = ['One Punch', 'Samurai X', 'Dragon Ball']
  return (
    <div className="App">
      <h1>GifExpertApp</h1>
      <hr/>
      <ol>
        {
          categories.map((category, index) => {
            return <li>category</li>
          })
        }
      </ol>
    </div>
  );
}

export default App;

/**
 * usando un map espera un key que debe ser unica
 */
